import "./ChefCard.css";
interface IChefCard {
  img: string;
  name: string;
}
const ChefCard: React.FC<IChefCard> = (props) => {
  return (
    <div className="cardChef">
      <img className="chefImg" src={props.img} alt={props.name} />
      {/* <div className="buttomCard">
        <h3>{props.name}</h3>
      </div> */}
    </div>
  );
};
export default ChefCard;
